`,paraId:34,tocIndex:20},{value:"\u5148\u5C06\u7070\u8272\u7684 A \u4ECE Q \u7684\u9996\u90E8\u53D6\u51FA",paraId:35,tocIndex:20},{value:"\u53D6\u51FA A \u540E\uFF0C\u5C06 A \u7684\u6240\u6709\u672A\u88AB\u8BBF\u95EE\u8FC7\uFF08\u767D\u8272\uFF09\u7684\u76F8\u90BB\u9876\u70B9\u4F9D\u6B21\u4ECE\u961F\u5217 Q \u7684\u5C3E\u90E8\u52A0\u5165\u961F\u5217\uFF0C\u5E76\u53D8\u4E3A\u7070\u8272\u3002\u4EE5\u6B64\u4FDD\u8BC1\uFF0C\u7070\u8272\u7684\u76F8\u90BB\u9876\u70B9\u4E0D\u91CD\u590D\u52A0\u5165\u961F\u5217",paraId:35,tocIndex:20},{value:"A \u7684\u5168\u90E8\u76F8\u90BB\u8282\u70B9\u52A0\u5165 Q \u540E\uFF0CA \u53D8\u4E3A\u9ED1\u8272\uFF0C\u5728\u4E0B\u4E00\u6B21\u5FAA\u73AF\u4E2D\u88AB\u79FB\u9664 Q \u5916",paraId:35,tocIndex:20},{value:`// 5.\u5E7F\u5EA6\u4F18\u5148\u904D\u5386
Graph.prototype.bfs = function (initV, handler) {
  var colors = this._initColors();
  var queue = new Queue();

  // \u5C06\u5B9A\u70B9\u653E\u5165\u961F\u5217
  queue.enqueue(initV);

  while (!queue.isEmpty()) {
    var qVal = queue.dequeue(); // \u62FF\u5230\u961F\u5934\u7684\u9876\u70B9
    var qAdj = this.adList.get(qVal); // \u62FF\u5230\u961F\u5934\u5BF9\u5E94\u7684\u8FB9
    // \u5C06\u961F\u5934\u8BBE\u7F6E\u6B63\u5728\u63A2\u7D22\u4E2D \u7070\u8272
    colors[qVal] = 'gray';

    // \u5C06\u961F\u5934\u9876\u70B9\u76F8\u90BB\u7684\u8FB9 \u5168\u90E8\u62FF\u51FA\u6765\u904D\u5386\u4E00\u904D\uFF0C\u5E76\u52A0\u5165\u5230\u961F\u5217\u4E2D
    for (var i = 0; i < qAdj.length; i++) {
      var vertexValue = qAdj[i]; // \u53D6\u51FA\u76F8\u90BB\u9876\u70B9
      // \u5982\u679C\u8FD9\u4E2A\u9876\u70B9\u662F\u767D\u8272\uFF0C\u8BF4\u660E\u6CA1\u6709\u88AB\u8BBF\u95EE\u8FC7
      if (colors[vertexValue] === 'white') {
        // \u6B63\u5728\u8BBF\u95EE
        colors[vertexValue] = 'gray';
        // \u5C06\u76F8\u90BB\u9876\u70B9\u5165\u961F
        queue.enqueue(vertexValue);
      }
    }

    // \u4EE3\u8868\u8BE5\u5B9A\u70B9\u5DF2\u7ECF\u63A2\u7D22\u5B8C\u6BD5\uFF0C\u8BBE\u7F6E\u4E3A\u9ED1\u8272
    colors[qVal] = 'black';

    // \u8F93\u51FA
    handler && handler(qVal);
  }
};
