`,paraId:53,tocIndex:14},{value:"suffix: ",paraId:55,tocIndex:14},{value:"[ 120, 120, 60, 20, 5 ]",paraId:55,tocIndex:14},{value:"\u6700\u540E\u5728 res \u4E2D\uFF0C\u9664\u4E86\u81EA\u5DF1\uFF0C\u5C06\u5DE6\u4FA7\u548C\u53F3\u4FA7\u7684\u5143\u7D20\u76F8\u4E58",paraId:53,tocIndex:14},{value:"\u8DDF",paraId:53,tocIndex:14},{value:"\u5251\u6307 Offer66.\u6784\u5EFA\u4E58\u79EF\u6570\u7EC4",paraId:56,tocIndex:14},{value:"\u76F8\u540C",paraId:53,tocIndex:14},{value:`/**
 * @param {number[]} nums
 * @return {number[]}
 */
var productExceptSelf = function (nums) {
  const n = nums.length;
  if (n === 0) return [];
  // \u5047\u8BBE nums => [1,2,3,4,5]
  // \u4ECE\u5DE6\u5230\u53F3\u7684\u524D\u7F00\u79EF prefix[i]\u662Fnums[0...i]\u7684\u5143\u7D20\u79EF
  const prefix = Array(n); // => [ 1, 2, 6, 24, 120 ]
  prefix[0] = nums[0];
  for (let i = 1; i < n; i++) {
    prefix[i] = prefix[i - 1] * nums[i];
  }

  // \u4ECE\u53F3\u5230\u5DE6\u7684\u524D\u7F00\u79EF,suffix[i]\u662Fnums[i...n-1]\u7684\u5143\u7D20\u79EF
  const suffix = Array(n); // => [ 120, 120, 60, 20, 5 ]
  suffix[n - 1] = nums[n - 1];
  for (let i = n - 2; i >= 0; i--) {
    suffix[i] = suffix[i + 1] * nums[i];
  }

  const res = Array(n);
  res[0] = suffix[1];
  res[n - 1] = prefix[n - 2];
  for (let i = 1; i < n - 1; i++) {
    // \u9664\u4E86nums[i]\u81EA\u5DF1\uFF0C\u5DE6\u4FA7\u548C\u53F3\u4FA7\u7684\u6240\u6709\u5143\u7D20\u7684\u79EF
    res[i] = prefix[i - 1] * suffix[i + 1];
  }
  return res;
};
